import './index';

const App = () => {

    return(
    <>
      <div className="main_div">
          <div>
              <h1>ToDo List </h1>
              <br/>
              <input type="text" placeholder="Add an item"></input>
              <button>+</button>
              <ol>
                  <li>Buy Apple</li>
              </ol>
          </div>
      </div>    
    </>
    );
}

export default App;
